vec3 channel3 = vec3(0);
void main() {

  float f = lut_0();
  float r = (float(getDataValue(0).value) / 255.); // Red channel
  float g = (float(getDataValue(1).value) / 255.); // Green channel
  float b = (float(getDataValue(2).value) / 255.); // Blue channel  

  float brightness = f; // Brightness (Alpha channel)

  emitRGBA(vec4(r * brightness, g * brightness, b * brightness, 1.0));
}
